import React from "react";
import Login from "./components/Login";
import Signup from "./components/Signup";
import Dashboard from "./components/Dashboard";
import { BrowserRouter, Routes, Route, Link } from "react-router-dom";

export default function App() {
  return (
    <BrowserRouter>
      <header className="app-header">
        <div style={{display:"flex", alignItems:"center", gap:12}}>
          <div style={{width:36, height:36, borderRadius:8, background:'#fff', display:'flex', alignItems:'center', justifyContent:'center', color:'#1677ff', fontWeight:700}}>B</div>
          <h3 style={{margin:0, color:"white"}}>Billwise</h3>
        </div>
        <nav>
          <Link to="/login" className="btn btn-light me-2">Login</Link>
          <Link to="/signup" className="btn btn-light">Signup</Link>
        </nav>
      </header>

      <Routes>
        <Route path="/" element={<Dashboard />} />
        <Route path="/login" element={<Login />} />
        <Route path="/signup" element={<Signup />} />
      </Routes>
    </BrowserRouter>
  );
}
